          "id": "abd2673e4463ec1d02ab244b4bce9331dec99182",
          "message": "MAINT: Cleanup of annotations (#1745)\n\nThe goal of this PR is to create a more intuitive interface for creating annotations. The AnnotationBuild gets deprecated in favor of several annotation classes, e.g.\r\n\r\n```python\r\n# old\r\nfrom pypdf.generic import AnnotationBuilder\r\nannotation = AnnotationBuilder.free_text(\r\n    \"Hello World\\nThis is the second line!\",\r\n    rect=(50, 550, 200, 650),\r\n    font=\"Arial\",\r\n    bold=True,\r\n    italic=True,\r\n    font_size=\"20pt\",\r\n    font_color=\"00ff00\",\r\n    border_color=\"0000ff\",\r\n    background_color=\"cdcdcd\",\r\n)\r\n\r\n# new\r\nfrom pypdf.annotations import FreeText\r\nannotation = FreeText(\r\n    text=\"Hello World\\nThis is the second line!\",\r\n    rect=(50, 550, 200, 650),\r\n    font=\"Arial\",\r\n    bold=True,\r\n    italic=True,\r\n    font_size=\"20pt\",\r\n    font_color=\"00ff00\",\r\n    border_color=\"0000ff\",\r\n    background_color=\"cdcdcd\",\r\n)\r\n```\r\n\r\n* `pypdf/generic/_annotations.py` âž” `pypdf/annotations/`\r\n* Create abstract base class AnnotationDictionary\r\n* Create abstract base class MarkupAnnotation which inherits from AnnotationDictionary. Most annotations are MarkupAnnotations.\r\n* Deprecated AnnotationBuilder\r\n* Ensure the AnnotationBuilder is not used in the docs\r\n\r\nCloses #107",
          "timestamp": "2023-07-29T11:20:03+02:00",
          "tree_id": "e2fb9d9e7617fb68baf0fee47528de8067fd3bfc",
